/* qpsol:(h[24x24,112nz],g[24],a[72x24,296nz],lba[72],uba[72],lbx[24],ubx[24],x0[24],lam_x0[24],lam_a0[72],q[],p[])->(x[24],cost,lam_a[72],lam_x[24]) */
static int casadi_f14(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s22;
  p.sp_h = casadi_s39;
  p.sp_at = casadi_s23;
  p.sp_kkt = casadi_s45;
  p.sp_v = casadi_s46;
  p.sp_r = casadi_s47;
  p.prinv = casadi_s48;
  p.pc =  casadi_s49;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 24, d.lbz);
  } else {
    casadi_fill(d.lbz, 24, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 72, d.lbz+24);
  } else {
    casadi_fill(d.lbz+24, 72, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 24, d.ubz);
  } else {
    casadi_fill(d.ubz, 24, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 72, d.ubz+24);
  } else {
    casadi_fill(d.ubz+24, 72, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 24, d.z);
  } else {
    casadi_clear(d.z, 24);
  }
  casadi_fill(d.z+24, 72, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 24, d.lam);
  } else {
    casadi_clear(d.lam, 24);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 72, d.lam+24);
  } else {
    casadi_clear(d.lam+24, 72);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 24, res[0]);
  if (res[3]) casadi_copy(d.lam, 24, res[3]);
  if (res[2]) casadi_copy(d.lam+24, 72, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

/* solver:(x0[24],p[49],lbx[24],ubx[24],lbg[72],ubg[72],lam_x0[24],lam_g0[72])->(x[24],f,g[72],lam_x[24],lam_g[72],lam_p[49]) */
static int casadi_f3(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  casadi_int iter_count=0, ls_iter=0, *m_iw;
  casadi_real F_sens, du_inf, dx_norminf, fk_cand, l1, l1_cand, l1_infeas, m_f, **m_res=res+6, *m_w, pr_inf, sigma=0.0, t=0.0, tl1;
  const casadi_real **m_arg=arg+8, *m_p=arg[1], one=1;
  struct casadi_nlpsol_data d_nlp;
  struct casadi_nlpsol_prob p_nlp;
  struct casadi_sqpmethod_data d;
  struct casadi_sqpmethod_prob p;
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 24;
  p_nlp.ng = 72;
  p_nlp.np = 49;
  casadi_nlpsol_init(&d_nlp, &iw, &w);
  if (arg[0]) {
    casadi_copy(arg[0], 24, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 24);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 24, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 24);
  }
  if (arg[7]) {
    casadi_copy(arg[7], 72, d_nlp.lam+24);
  } else {
    casadi_clear(d_nlp.lam+24, 72);
  }
  if (arg[2]) {
    casadi_copy(arg[2], 24, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 24, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 24, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 24, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 72, d_nlp.lbz+24);
  } else {
    casadi_fill(d_nlp.lbz+24, 72, -casadi_inf);
  }
  if (arg[5]) {
    casadi_copy(arg[5], 72, d_nlp.ubz+24);
  } else {
    casadi_fill(d_nlp.ubz+24, 72, casadi_inf);
  }
  d.prob = &p;
  p.sp_h = casadi_s39;
  p.sp_a = casadi_s22;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
  casadi_sqpmethod_init(&d, &iw, &w);
  m_w = w;
  m_iw = iw;
  casadi_clear(d.dx, 24);
  /* MAIN OPTIMIZATION LOOP */
  while (1) {
    /* Evaluate f, g and first order derivative information */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_res[0] = &m_f;
    m_res[1] = d.gf;
    m_res[2] = d_nlp.z+24;
    m_res[3] = d.Jk;
    if (casadi_f6(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Evaluate the gradient of the Lagrangian */
    casadi_copy(d.gf, 24, d.gLag);
    casadi_mv(d.Jk, casadi_s22, d_nlp.lam+24, d.gLag, 1);
    casadi_axpy(24, 1.0, d_nlp.lam, d.gLag);
    /* Primal infeasability */
    pr_inf = casadi_max_viol(96, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(24, d.gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(24, d.dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
    if (iter_count >= 1 && iter_count >= 0 && dx_norminf <= 1e-10) break;
    /* Update/reset exact Hessian */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_arg[2] = &one;
    m_arg[3] = d_nlp.lam+24;
    m_res[0] = d.Bk;
    if (casadi_f10(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Formulate the QP */
    casadi_copy(d_nlp.lbz, 96, d.lbdz);
    casadi_axpy(96, -1.0, d_nlp.z, d.lbdz);
    casadi_copy(d_nlp.ubz, 96, d.ubdz);
    casadi_axpy(96, -1.0, d_nlp.z, d.ubdz);
    /* Initial guess */
    casadi_copy(d_nlp.lam, 96, d.dlam);
    casadi_clear(d.dx, 24);
    /* Increase counter */
    iter_count++;
    /* Solve the QP */
    m_arg[0] = 0;
    m_arg[1] = 0;
    m_arg[2] = 0;
    m_arg[3] = 0;
    m_arg[4] = 0;
    m_arg[5] = 0;
    m_arg[6] = 0;
    m_arg[7] = 0;
    m_arg[8] = 0;
    m_arg[9] = 0;
    m_arg[10] = 0;
    m_arg[11] = 0;
    m_arg[0] = d.Bk;
    m_arg[1] = d.gf;
    m_arg[7] = d.dx;
    m_arg[8] = d.dlam;
    m_arg[9] = d.dlam+24;
    m_arg[5] = d.lbdz;
    m_arg[6] = d.ubdz;
    m_arg[2] = d.Jk;
    m_arg[3] = d.lbdz+24;
    m_arg[4] = d.ubdz+24;
    m_res[0] = 0;
    m_res[1] = 0;
    m_res[2] = 0;
    m_res[3] = 0;
    m_res[0] = d.dx;
    m_res[3] = d.dlam;
    m_res[2] = d.dlam+24;
    casadi_f14(m_arg, m_res, m_iw, m_w, 0);
    /* Detecting indefiniteness */
    /* Calculate penalty parameter of merit function */
    sigma = casadi_fmax(sigma, (1.01*casadi_norm_inf(96, d.dlam)));
    /* Calculate L1-merit function in the actual iterate */
    l1_infeas = casadi_sum_viol(96, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* Right-hand side of Armijo condition */
    F_sens = casadi_dot(24, d.dx, d.gf);
    tl1 = F_sens - sigma * l1_infeas;
    l1 = m_f + sigma * l1_infeas;
    /* Stepsize */
    t = 1.0;
    /* Merit function value in candidate */
    l1_cand = 0.0;
    /* Reset line-search counter, success marker */
    ls_iter = 0;
    /* Line-search loop */
    while (1) {
      /*  Increase counter */
      ls_iter++;
      /* Candidate step */
      casadi_copy(d_nlp.z, 24, d.z_cand);
      casadi_axpy(24, t, d.dx, d.z_cand);
      /* Evaluating objective and constraints */
      m_arg[0] = d.z_cand;
      ;m_arg[1] = m_p;
      ;m_res[0] = &fk_cand;
      ;m_res[1] = d.z_cand+24;
      ;if (casadi_f4(m_arg, m_res, m_iw, m_w, 0)) {
        /* Avoid infinite recursion */
        if (ls_iter == 3) {
          break;
        }
        /* line-search failed, skip iteration */
        t = 0.8* t;
        continue;
      }
      /* Calculating merit-function in candidate */
      l1_cand = fk_cand + sigma * casadi_sum_viol(96, d.z_cand, d_nlp.lbz, d_nlp.ubz);
      if (l1_cand <= l1 + t * 0.0001* tl1) {
        break;
      }
      /* Line-search not successful, but we accept it. */
      if (ls_iter == 3) {
        break;
      }
      /* Backtracking */
      t = 0.8* t;
    }
    /* Candidate accepted, update dual variables */
    casadi_scal(96, 1-t, d_nlp.lam);
    casadi_axpy(96, t, d.dlam, d_nlp.lam);
    casadi_scal(24, t, d.dx);
    /* Take step */
    casadi_axpy(24, 1.0, d.dx, d_nlp.z);
  }
  m_arg[0] = d_nlp.z;
  m_arg[1] = m_p;
  m_arg[2] = &one;
  m_arg[3] = d_nlp.lam+24;
  m_res[0] = 0;
  m_res[1] = 0;
  m_res[2] = 0;
  m_res[3] = d_nlp.lam_p;
  if (casadi_f13(m_arg, m_res, m_iw, m_w, 0)) return 1;
  casadi_scal(49, -1.0, d_nlp.lam_p);
  if (res[0]) casadi_copy(d_nlp.z, 24, res[0]);
  if (res[2]) casadi_copy(d_nlp.z+24, 72, res[2]);
  if (res[3]) casadi_copy(d_nlp.lam, 24, res[3]);
  if (res[4]) casadi_copy(d_nlp.lam+24, 72, res[4]);
  if (res[5]) casadi_copy(d_nlp.lam_p, 49, res[5]);
  if (res[1]) casadi_copy(&m_f, 1, res[1]);
  return 0;
}

